            var w = document.body.clientWidth-20,
                h = document.body.clientHeight-20,
                x = pv.Scale.linear(0, m - 1).range(200, w),
                y = pv.Scale.linear(0, 1).range(0, h - 25);
             
            var vis = new pv.Panel()
                .width(w)
                .height(h)

            vis.add(pv.Rule)
                .data(pv.range(0, dates.length, 20))
                .left(x)
                .height(5)
              .anchor("bottom").add(pv.Label)
              .text(function(d) dates[d])
             
            var area = vis.add(pv.Layout.Stack)
                .layers(data)
                .x(x.by(pv.index))
                .y(y)
              .layer.add(pv.Area)
                .strokeStyle(function() this.fillStyle().alpha(.5));

            vis.add(pv.Panel)
                .extend(area.parent)
              .add(pv.Area)
                .extend(area)
              .anchor("center").add(pv.Label)
                .visible(function() this.index == 0)
                .textAlign("left")
                .textBaseline("top")
                .left(0)
                .text(function() labels[this.parent.index])
             
            vis.render();
            
        </script>
    </body>
</html>
